import { useState, useEffect } from "react";
import "../style/Main.css";
import axios from "axios";

const App = () => {
    const [myData, setMyData] = useState([]);
    const [isError, setIsError] = useState("");

    // using Promises
    useEffect(() => {
        axios
            .get("http://localhost:8989/getAllStudent")
            .then((response) => {
                console.log(response.data)
                setMyData(response.data)
            })
            .catch((error) => setIsError(error.message));
    }, []);

    //plz subscribe to thapa technical
    return (
        <>
            <h1>All users</h1>
            {isError !== "" && <h2>{isError}</h2>}

            <div className="grid">
                {myData.slice(0, 8).map((post) => {
                    // const { body, id, title } = post;
                    return (
                        <div className="card">
                            <table>
                                <tr>
                                    <th>Name</th>
                                    <th>Rollnumber</th>
                                    <th>Age</th>
                                    <th>Department</th>
                                    <th>Address</th>
                                </tr>
                                <tr key={(post.roll)}>
                                    {/* <td>{post.id}</td> */}
                                    <td>{post.name}</td>
                                    <td>{post.roll}</td>
                                    <td>{post.age}</td>
                                    <td>{post.department}</td>
                                    <td>{post.address}</td>
                                </tr>
                            </table>
                        </div>
                    );
                })}
            </div>
        </>
    );
};

export default App;
